  false,\n\t\"url\": null,\n\t\"notes\": \"This report covers the yellow-billed loon
  populations on the Colville river delta in the Arctic Alaska. The estimates sizes
  of the 1982 and 1984 yellow-billed look populations on the Colville River delta.
  We also estimated the numbers of pairs and active nests. Wetlands were surveyed
  along transects in 1982 and in blocks in1984. Study area, methods and results are
  provided.\",\n\t\"owner_org\": \"4d7ad1cd-3641-420b-8116-e4082f49cd44\",\n\t\"extras\":
